import React from "react"

const styles = {
    body__filter: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },

    body__button: {
        marginRight: '20px',
        border: '0',
        outline: '0',
        fontSize: '16px',
        borderRadius: '15px',
        padding: '16px',
        borderRadius: '15px',
        backgroundColor: '#EBECF0',
        textShadow: '1px 1px 0 #ffffff',
        width: '15%',
        boxSizing: 'border-box',
        appearance: 'none',
        color: '#61677C',
        transition: 'all 0.2s ease-in-out',
        cursor: 'pointer',
        fontWeight: '600',
    },
};

export default function TodoFilter(props) {
    return (
        <div style={styles.body__filter}>
            <button style={styles.body__button} className='body__button'>All</button>
            <button style={styles.body__button} className='body__button'>Active</button>
            <button style={styles.body__button} className='body__button'>Completed</button>
        </div>
    )
}
